import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import AddCar from "./AddCar";
import BookCar from "./BookCar";
import "./styles.css";

function App() {
  return (
    <BrowserRouter>
      <header className="app-header">
        <div className="header-inner">
          <h1 className="brand">CarShare</h1>
          <nav className="nav">
            <Link className="nav-link" to="/">Home</Link>
            <Link className="nav-link" to="/add">Add Car</Link>
            <Link className="nav-link" to="/book">Book Car</Link>
          </nav>
        </div>
      </header>

      <main className="main">
        <Routes>
          <Route path="/" element={
            <div className="page">
              <div className="card welcome-card">
                <h2>Welcome to CarShare</h2>
                <p>Use the navigation to add or book cars.</p>
                <div className="cta-row">
                  <Link className="btn primary" to="/book">Browse Cars</Link>
                  <Link className="btn secondary" to="/add">Add a Car</Link>
                </div>
              </div>
            </div>
          }/>
          <Route path="/add" element={<AddCar />} />
          <Route path="/book" element={<BookCar />} />
        </Routes>
      </main>

      <footer className="footer">
        <div className="footer-inner">Â© {new Date().getFullYear()} CarShare</div>
      </footer>
    </BrowserRouter>
  );
}

export default App;
